        public int BuscarCodigo(string[] arr, string codigo)
        {
            for (int i = 0; i < arr.Length; i++)
            {
                if (arr[i] == codigo)
                {
                    // Imprimir la posición del código en el arreglo
                    Console.WriteLine("Posición del código en el arreglo: " + i);

                    // Imprimir la dirección de memoria del código
                    Console.WriteLine("Dirección de memoria del código: " + System.Runtime.InteropServices.GCHandle.ToIntPtr(System.Runtime.InteropServices.GCHandle.Alloc(arr[i])));

                    return i;
                }
            }
            return -1; // Retorna -1 si el código no se encuentra en el arreglo
        }

